const RDXabi = require('./RedDotToken.json')
const WJKabi = require('./WojakToken.json')
const UNIabi = require('./UniToken.json')
const MSCabi = require('./MasterChef.json')

const MasterChef = {
    contractABI: MSCabi.abi,
    contractAddress: '0xcaE7B7ec5174d2380f49ADf93106cd420d77B460'
}

const WJKToken = {
    contractABI: WJKabi.abi,
    contractAddress: '0xcC3bC2a2080eE0154dC7688E0e5858f735a79d41'
}

const UNIToken = {
    contractABI: UNIabi.abi,
    contractAddress: '0x06C9C35C8BD92F37e48024F85daCA0739454faf3'
}

const RDXToken = {
    contractABI: RDXabi.abi,
    contractAddress: '0xCb6d2Eb97BB9E9F2634e6ff3d476334d54E3458f'
}

const INFURA_API = 'https://ropsten.infura.io/v3/8bf322110b8c4fbf87055c7fd3981adf'

module.exports = {
    MasterChef, UNIToken, RDXToken, WJKToken, INFURA_API
}
